<!DOCTYPE html>
<html lang="ru">

<head>
    <meta charset="UTF-8">
    <meta name="robots" content="noindex, nofollow">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Калькулятор цен</title>
    <link rel="icon" href="favicon.ico" type="image/x-icon"/>
    <style>body{box-sizing:border-box;margin:0;padding:0;line-height:1.2;font-family:Montserrat,Roboto,sans-serif}.wrap{margin:0 auto;padding:1rem;max-width:600px}.grid{display:grid;grid-template-columns:1fr 1fr;align-items:center;justify-content:center}@media screen and (max-width:650px){.grid{grid-template-columns:1fr}}.grid>div{box-sizing:border-box;padding:.3rem}button{border:none;background:#005180;color:#fff;width:100%;height:100%;padding:.5rem 1rem;font-size:1.2rem;font-weight:700;cursor:pointer}input{outline:0;border:1px solid #ccc;border-radius:4px;font-size:1.1rem;line-height:1.4;padding:2px 5px}input:focus,input:focus-visible,input:focus-within{border-color:#222}input:disabled{font-weight:500;background-color:#00518033;color:#222}</style>
</head>

<body>
    <div class="wrap">
        <form id="f0" class="grid">
            <div>
                <label for="cost"> Себестоимость, руб.
                    <input type="number" id="cost" name="cost" value="0" max="9999999999" />
                </label>
            </div>
            <div>
                <label for="extPrice"> Наценка, %
                    <input type="number" id="extPrice" name="extPrice" value="100" max="10000000" />
                </label>
            </div>
            <div>
                <label for="discount"> Согласованная "Скидка", %
                    <input type="number" id="discount" name="discount" value="30" />
                </label>
            </div>
            <div>
                <label for="promocode"> Согласованный "Промокод", %
                    <input type="number" id="promocode" name="promocode" value="30" />
                </label>
            </div>
            <div>
                <label for="wildberries"> Вознаграждениe Wildberries, %
                    <input type="number" id="wildberries" name="wildberries" value="15" />
                </label>
            </div>
            <div>
                <label for="order"> Обработка заказа, руб.
                    <input type="number" id="order" name="order" value="78.11" step="0.01" />
                </label>
            </div>
            <div>
                <label for="taxRate"> Ставка налога, %
                    <input type="number" id="taxRate" name="taxRate" value="6" />
                </label>
            </div>
            <div onclick="cpcb(this.querySelector('input').value);">
                <label for="total"> Цена, руб.
                    <input type="number" id="total" name="total" disabled value="0" />
                </label>
            </div>
            <div onclick="cpcb(this.querySelector('input').value);">
                <label for="afterDiscount"> Цена-"Скидка", руб.
                    <input type="number" id="afterDiscount" name="afterDiscount" disabled value="0" />
                </label>
            </div>
            <div onclick="cpcb(this.querySelector('input').value);">
                <label for="result"> Цена-"Скидка"-"Промокод", руб.
                    <input type="number" id="result" name="result" disabled value="0" />
                </label>
            </div>
            <div onclick="cpcb(this.querySelector('input').value);">
                <label for="afterTax"> После вычета налога, руб.
                    <input type="number" id="afterTax" name="afterTax" disabled value="0" />
                </label>
            </div>
            <div>
                <label for="revenue"> Прибыль, руб.
                    <input type="number" id="revenue" name="revenue" disabled value="0" />
                </label>
            </div>
            <div>
                <button type="submit" id="btn">Рассчитать</button>
            </div>
        </form>
    </div>
